import react from "react";
import Blog from "./Blog";
import './CSS/Blog.css';

const Home = () => {
    return (
        <div className="blog-wrap">
            <Blog 
                tanggal = "17 Mei 2022"
                judul = "Teknologi Blockhain"
                summary = "Lorem ipsum dolor sit, amet consectetur adipisicing elit. Possimus, reiciendis!" /> 
        </div>
    )
}

export default Home;
